import React from 'react';
import PropTypes from 'prop-types';

const Checkbox = ({ type = 'checkbox', name, dataid = null, id, isChecked = 0, disabled, onChangeFunction }) => {
    /*const [checkedItem, setCheckedItem] = React.useState(checked);
    const changeCheckedInput = (e) => {
        setCheckedItem(!checked);
        onCheckedChange(e);
    };*/
    return <input type={type} name={name} dataid={dataid} id={id} checked={isChecked} disabled={disabled}
           onChange={onChangeFunction}/>;
};

Checkbox.propTypes = {
    type: PropTypes.string,
    name: PropTypes.string.isRequired,
    id: PropTypes.number,
    dataid: PropTypes.number,
    isChecked: PropTypes.bool,
    disabled: PropTypes.bool,
    onChangeFunction: PropTypes.func.isRequired,
};

export default Checkbox;
